function changeFlag(){
	var english = document.getElementById("english");
	var spanish = document.getElementById("spanish");
	var selectLanguage = document.getElementById("selectLanguage");
	
	if(selectLanguage.value == "ES"){
		english.style.display = "none";
		spanish.style.display = "block";
	}
	
	if(selectLanguage.value == "IN"){
		english.style.display = "block";
		spanish.style.display = "none";
	}
}

function imageDesignPet(){
	var id = document.getElementById("id").value;
	var strBase64 = document.getElementById("strBase64").value;

	var doc = new jsPDF()
	var qr ='data:image/png;base64,'+ strBase64;
	var pet = 'data:image/png;base64,';
	var guard = 'data:image/png;base64,';
	
		/* Image 40% Configuration for 3.7 x 3.5 cm*/
		doc.addImage(qr, 'PNG', 0, 5, 35, 35);
		doc.addImage(pet, 'JPEG', 14, 19, 7, 7 );
		doc.addImage(guard, 'PNG', 1, 5.7 , 33.5, 35.9);
		doc.setFontSize(7);
		doc.text(id, 2, 40.5);
		
		/* Image 50% */
		doc.addImage(qr, 'PNG', 50, 5, 50, 50);
		doc.addImage(pet, 'JPEG', 70, 24, 10, 10 );
		doc.setFontSize(10);
		doc.text(id, 53, 56);
		
		/* Image 70% */
		doc.addImage(qr, 'PNG', 110, 5, 70, 70);
		doc.addImage(pet, 'JPEG', 138, 32, 13, 13 );
		doc.setFontSize(14);
		doc.text(id, 115, 76);
		
		doc.save('petQR_pet_a4.pdf');
	}

